Vacation (1983) 

The Griswold family are on a quest. A quest to a Walley World theme park for a family vacation, but things aren't going to go exactly as planned, especially when Clark Griswold is losing all thought towards a mysterious blonde in a red Ferrari. Written by FilmFanUK

The Griswold family, father Clark W., wife Ellen, daughter Audrey and son Rusty, set out in high spirit to spend their vacation driving cross-country from Chicago to a glorious climax in Walley World on the West Coast. The trip which Clark planned down to the minute, slowly loses its smoothness from the moment the first grain of sand gets in. A meeting with constantly-in-debt, simple-minded cousin Eddie results in the Griswold family giving cantankerous aunt Edna a lift to Phoenix. Of course, the Griswolds receive one strike of bad luck after another, and when they finally arrive at Walley World, they have to find out that the park is closed for maintenance. But Clark promised his beloved family the best vacation ever... Written by Julian Reischl {&lt;a class=&quot;__cf_email__&quot; href=&quot;/cdn-cgi/l/email-protection&quot; data-cfemail=&quot;6c061900050d021e09051f0f04002c010d0f420f0301&quot;&gt;[email&amp;#160;protected]&lt;/a&gt;&lt;script cf-hash='f9e31' type=&quot;text/javascript&quot;&gt;
