In a game show called &quot;Pig In A Poke,&quot; the Griswold family -- Clark, Ellen, Rusty, and Audrey -- accidentally wins a trip to Europe, winning against a family that had previously never been defeated on this game show, which is hosted by Kent Winkdale. Just before the trip, Clark makes an erotic videotape of Ellen, promising to erase the tape later. Clark likes the game show's itinerary of what they are scheduled to do in Europe, but Ellen and the kids don't feel the same way. They begin their trip to Europe in London, England, where they stay in a ratty hotel. Clark has problems learning how to drive European cars, which have the steering wheel on the right side instead of the left side. In England, the Griswolds see things like Big Ben, Parliement, and Buckingham Palace. Audrey misses her boyfriend Jack so much that she wants to go back to Chicago. Clark is oblivious to how his family feels as he takes the family to see places such as Stonehenge, which Clark accidentally knocks down by backing a rented car into it. The trip to Europe then moves from London to Paris, France, where Clark has a French man use the camcorder to tape the Griswolds near a water fountain, but the French man steals the camera, with a videotape inside of it. In Paris, the Griswolds visit the Eiffel tower. The hotel room they check into in Paris is better than the one they had in London. The Griswolds visit the Musee De Louvre, then Audrey gets a letter from Jack, saying that Jack has been seeing Audrey's best friend Debbie while Audrey is in Europe. The next stop for the Griswolds is Germany, to visit their long lost relatives Fritz and Helga, but they end up at the wrong house and mistake this house's residents as their relatives. Nevertheless, they have a nice visit. Next, the Griswolds visit a festival where Clark joins in on some German dancing that he has no idea how to do. Not surprisingly, the dancing ends with a fistfight. The Griswolds get on a train to Rome, Italy, but on the way there, they get off the train to go to the travelers check place, but they are greeted by a pair of men that they don't know are robbing the place. After getting $3,000 from the place, the Griswolds get a car from the same two men, who have placed the clerk in the trunk of the car, and the Griswolds make their way into Rome, where they buy new clothes and Ellen sees a picture of herself on a billboard -- the thief who stole their video camera has been selling copies of the erotic tape of Ellen, which Clark forgot to erase, and Ellen is livid. The two thieves, the ones who robbed the place where the Griswolds got the $3000, show up in Rome, and one of them, who has fallen for Ellen, kidnaps Ellen. Audrey sees the guy leaving with Ellen, and Audrey and Clark set off to rescue Ellen. Written by Todd Baldridge

In a game show family Griswald wins a trip to Europe. They set out for Britain, France, Germany and Italy, ignorant to the damage they do to other people: In Britain Clark has slight problems to adapt to driving on the left side, runs several people over and accidentally lays down Stone Henge in reverse gear. In Germany they visit the wrong relatives and are chased by angry 'Schuhplattl' dancers. Finally in Rome they unknowingly help robbers in a hold-up and then Ellen gets kidnapped... simple jokes, always following the same scheme. Written by Tom Zoerner {&lt;a class=&quot;__cf_email__&quot; href=&quot;/cdn-cgi/l/email-protection&quot; data-cfemail=&quot;7a2e15175420151f08141f083a13141c1508171b0e1311540f1413571f08161b141d1f14541e1f&quot;&gt;[email&amp;#160;protected]&lt;/a&gt;&lt;script cf-hash='f9e31' type=&quot;text/javascript&quot;&gt;
