When the Griswolds accidentally win the grand prize on the &quot;Pig in a poke&quot; TV show, a trip to Europe for all of them, they happily decide to go. But the family's name would not be Griswold if everything went without complication. In London, they see Big Ben and Parliament extensively, but only after Clark learned to drive on the left side by not doing so; in Paris, Rusty's hormones disastrously spring to live; in Germany, the Griswolds visit the wrong relatives and in Italy, the family gets in touch with crime and a videotape that was in the camera that was stolen back in Paris. In addition, Audrey, who is in love with less-caring beau Jack, keeps ringing up the phone bill, Rusty keeps hitting on girls and Ellen keeps keeping them all together when times are bad. Written by Julian Reischl {&lt;a class=&quot;__cf_email__&quot; href=&quot;/cdn-cgi/l/email-protection&quot; data-cfemail=&quot;204a554c49414e5245495343484c604d41430e434f4d&quot;&gt;[email&amp;#160;protected]&lt;/a&gt;&lt;script cf-hash='f9e31' type=&quot;text/javascript&quot;&gt;
