This year, Clark Griswold is really into Christmas, and promises his family the best Christmas ever. However, instead of the best Christmas ever, Clark turns Christmas evening completely around, causing a domino effect of disasters that eventually seems to drive everyone crazy. Written by Chris Wang 




Vegas Vacation (1997)

The Griswolds head off for Las Vegas, as Clark got an extra bonus for developing a food preservative. In the city of fortune, the family ties are once again tested by forces of nature: Ellen finds herself tempted by Wayne Newton, Clark manages to lose all the money the Griswolds own, Rusty, not being 21 years of age yet, hits a lucky streak as Mr. Pappagiorgio and Audrey teams up with Cousin Eddie's daughter Vickie to dance at very interesting night clubs. Also, the Griswolds nearly cause the breaking of Hoover Dam, Clark meets some of Siegfried and Roy's white tigers up close and Cousin Eddie, who now owns some land right out of Las Vegas, gladly offers his helping hand. But the feeling of love and family will bring them all back together again, be it richer or poorer than before - what does money matter anyway?  Written by Julian Reischl {&lt;a class=&quot;__cf_email__&quot; href=&quot;/cdn-cgi/l/email-protection&quot; data-cfemail=&quot;84eef1e8ede5eaf6e1edf7e7ece8c4e9e5e7aae7ebe9&quot;&gt;[email&amp;#160;protected]&lt;/a&gt;&lt;script cf-hash='f9e31' type=&quot;text/javascript&quot;&gt;
